import React from "react";
import { Link } from "react-router-dom";

function Page404(){
    return(
        <>
            <h1>404 Page</h1>
            <p>This is our Page404 page</p>
            <Link to="/">Go to Home Page</Link>
        </>
    )
}


export default Page404;
